import React, { useEffect } from "react";
import axios from "axios";

useEffect(() => {
  axios
    .post(`https://pre-prod-api.baeprotein.com/api/v1/filtered-products`)
    .then((res) => {
      console.log(res);
    })
    .catch(() => {});
}, []);
const Cards = () => {
  return (
    <React.Fragment>
      <div className="card-main"></div>
    </React.Fragment>
  );
};

export default Cards;
